// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import UserList from './UserList';
import UserForm from './UserForm';

function App() {
    return (
        <Router>
            <div className="App">
                <Switch>
                    <Route exact path="/" component={UserList} />
                    <Route path="/kallpa" render={() => <UserForm company="Kallpa" />} />
                    <Route path="/energy" render={() => <UserForm company="Energy" />} />
                </Switch>
            </div>
        </Router>
    );
}

export default App;
